  - predicate: rdfs:comment
    object: 'GO graph seems to suggest this is an endothelium. WP: The endocardial
      cushions are thought to arise from a subset of endothelial cells that undergo
      epithelial to mesenchymal transformation, a process whereby these cells break
      cell-to-cell contacts and migrate into the cardiac jelly (towards to interior
      of the heart tube). Latest (2010-06-01) new def suggested for GO, added above.
      Note that EHDAA2 has a more detailed model which we may later adopt. JB: Patterning
